import {Link} from 'react-router-dom';
import '../styles/NavBar.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars} from '@fortawesome/free-solid-svg-icons';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

class NavBar extends Component {
    state = {
        toggle:false
    }
    Toggle = () => {
      this.setState({toggle:!this.state.toggle})
    }
    render(){
    return (
     {

                title: 'Photography Portfolio',
                description: 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Nunc sed augue lacus viverra vitae congue eu.',
                imageUrl: '../assets/asWebsite.png',
                id: 3,
                gitUrl:'',
                linkUrl:'',


            },
<>
            <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">Andrea Simental</Navbar.Brand>
    <Nav className="mr-auto">

      <Nav.Link to="/About">About Me</Nav.Link>
      <Nav.Link to="/About">Projects</Nav.Link>

      <Nav.Link to="/About">Resume</Nav.Link>
      <Nav.Link to="/About">Contact Me</Nav.Link>
    </Nav>

  </Navbar>

      <nav className ="navMenu">

          <Link className='navMenu-logo' to="/">Andrea Simental</Link>
          <FontAwesomeIcon icon={faBars} className="navMenu-burger" onClick={this.Toggle}/>


              <div className={this.state.toggle ? "dropdown": "navMenu-options"}>
                  <Link className='navMenu-option' to="/About">About Me</Link>
                  <Link className='navMenu-option' to="/Resume">Resume</Link>

                  <Link className='navMenu-option' to="/projects">Projects</Link>

                  <Link className='navMenu-option' to="/contact">Contact</Link>


              </div>


      </nav>
      </>
    );

    }
}


    export default NavBar;
